            applyCurrentWeatherForecast(smhi.approvedTime, forecastParam["t"].values[0], symbolsDayTxt[forecastParam["Wsymb2"].values[0]], forecastParam["wd"].values[0], forecastParam["ws"].values[0], forecastParam["spp"].values[0], forecastParam["msl"].values[0], forecastParam["r"].values[0], symbolsDay[forecastParam["Wsymb2"].values[0]]);

